import React from 'react'

//res.header('Access-Control-Allow-Origin', "*")
class AltUsers extends React.Component {
  constructor() {
    super();
    this.state = {
      names: [], 
    };
  }



componentDidMount() {
  fetch('http://127.0.0.1:5000/users')
  .then(results => {
    return results.json();
  }).then(res => {
    //let names = 
    console.log(res)
    res.data.map((user) => {
      console.log(user.name)
      return(
        <h1>{user.name}</h1>
      )
    })
  })
}
render() {
  return(
    this.state.name
  )
}
}
export default AltUsers
